// Home.js

import React, { useState } from 'react';

const Home = ({ handleQuestion2Change }) => {
  const [question2, setQuestion2] = useState('');

  const handleQuestion2Selection = (e) => {
    const value = e.target.value;
    setQuestion2(value);
    handleQuestion2Change(value);
  }

  return (
    <div>
      <h1>Home Page</h1>
      <h2>Question 2: What is the total distance between your home and workplace?</h2>
      <form>
        <label>
          <input type="radio" value="<5km" checked={question2 === '<5km'} onChange={handleQuestion2Selection} />
          &lt; 5 km
        </label>
        <br />
        <label>
          <input type="radio" value=">5km" checked={question2 === '>5km'} onChange={handleQuestion2Selection} />
          &gt; 5 km
        </label>
      </form>
    </div>
  );
}

export default Home;
